import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { ExplorerForm } from "./components/ExplorerForm";

function App() {
  const explorerForm = new ExplorerForm();
  return (
    <div className="App">
      <header className="App-header">{{ explorerForm }}</header>
    </div>
  );
}

export default App;
